import React from "react";
import { Link } from "react-router-dom";

const Landing = () => {
  return (
    <div className="landing">
      <div className="left">
        <div className="logo">
          <img src="logo.png" />
        </div>

        <div className="title-large">Blockchain</div>
        <div className="title-large">Voting System</div>
        <div className="title-small"></div>

        <div className="button-wrapper">
          <Link to="/login">
            <button className="glass-button primary-button">Login</button>
          </Link>

          <Link to="/view">
            <button className="glass-button secondary-button">View Votes</button>
          </Link>
        </div>
      </div>

      <div className="right">
        <img src="vote1.png" />
      </div>
    </div>
  );
};

export default Landing;
